import React from "react";
import DarkLightMode from "./navBarPages/DarkLightMode";
import Language from "./navBarPages/Language";

const NavBar = () => {
  return (
    <div id="NavBarMain" class="flex ">
      <DarkLightMode />
      <Language />
    </div>
  );
};

export default NavBar;
